import React from "react";
import { add, sub, mult, div } from "./Calc";

function App() {
    return (
        <>
            <ul>
                <li>Sum of Two Number is {add(5, 10)}</li>
                <li>Subtract of Two Number is {sub(10, 5)}</li>
                <li>Multiplication of Two Number is {mult(10, 5)}</li>
                <li>Division of Two Number is {div(10, 3)}</li>
            </ul>
        </>
    );
}
